import React from "react";
import SpellcheckIcon from '@material-ui/icons/Spellcheck';
import MicIcon from '@material-ui/icons/Mic';
import DynamicFeedRoundedIcon from '@material-ui/icons/DynamicFeedRounded';
import UndoPaste from "./HomeNavBar/undo_paste";
import Font_Size from "./HomeNavBar/Font_Size";
import Styling from "./HomeNavBar/Styling";
import TextFormatting from "./HomeNavBar/Text_formatting";
import Styles from "./HomeNavBar/Styles";

function BottomNavBar() {
    return <div className="bottomNav">
        <UndoPaste />
        <Font_Size />
        <Styling />
        <TextFormatting />
        <Styles />

        <div className="bottomObj" style={{ marginRight: "10px" }}>
            <img src="images/tags.png" />
            <p style={{ marginRight: "3px" }} >Tags</p>
            <img src="images/down-arrow.png" style={{ width: "12px", height: "12px", marginRight: "12px" }} />
            <div className="vl"></div>
        </div>
        <div className="bottomObj" style={{ marginRight: "10px" }}>
            <SpellcheckIcon style={{ marginRight: "3px" }} />
            <img src="images/down-arrow.png" style={{ width: "12px", height: "12px", marginRight: "12px" }} />
            <div className="vl"></div>
        </div>
        <div className="bottomObj" style={{ marginRight: "10px" }}>
            <MicIcon style={{ marginRight: "3px" }} />
            <img src="images/down-arrow.png" style={{ width: "12px", height: "12px", marginRight: "12px" }} />
            <div className="vl"></div>
        </div>
        <div className="bottomObj">
            <DynamicFeedRoundedIcon style={{ marginRight: "3px" }} />
            <p style={{ marginRight: "3px" }} >Feed</p>
            <div className="vl"></div>
        </div>
    </div>
}

export default BottomNavBar;
